import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input field
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Attempt XSS payload in the search input
    const xssPayload = `"><img src=x onerror=alert('xss')>`;
    await page.fill('#searchInput', xssPayload);

    // Take screenshot after filling XSS payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_payload_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_payload_filled.png'));

    // Try to trigger search using the search button (by class)
    // There are multiple .search-btn, pick the first visible one
    const searchBtn = await page.$('.search-btn');
    if (searchBtn) {
      await searchBtn.click();
    }

    // Take screenshot after clicking search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search_click.png'));

    // Check if the payload appears in the DOM (as HTML, not text)
    // We'll look for an <img> with src=x
    const imgExists = await page.$('img[src="x"]') !== null;

    // Optionally, extract any visible alerts or error messages (but do not handle dialogs)
    // Also extract if the XSS payload is reflected as text anywhere
    const pageContent = await page.content();
    const payloadReflected = pageContent.includes(xssPayload);

    return {
      success: true,
      action: "Attempted XSS via search input and triggered search",
      extractedData: {
        imgTagInjected: imgExists,
        payloadReflectedAsText: payloadReflected
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
